import './index.css';

export default function SelectedInput({value}) {
  if (value === 1) {
    return (
      <div className="input-selection-button">
        <h2>Weight 1</h2>
        <input type="number" name="calendar" placeholder="Your current weigth" />
      </div>
    );     
  }

  if (value === 2) {
    return (
      <div className="input-selection-button">
        <h2>Bench press 2</h2>
      </div>
    );     
  }

  if (value === 3) {
    return (
      <div className="input-selection-button">
        <h2>Squat 3</h2>
      </div>
    );     
  }

  if (value === 4) {
    return (
      <div className="input-selection-button">
        <h2>Dead lift 4</h2>
      </div>
    );     
  }
